import React, { useState } from 'react';
import { useForm } from 'react-hook-form';
import axios from 'axios';
import '../styles/BookingPage.css'; // Ensure correct path to styles
import logo from '../assets/logo.png'; // Importing the logo

const BookingPage = () => {
  const { register, handleSubmit } = useForm();
  const [pickupLocation, setPickupLocation] = useState('');
  const [destinationLocation, setDestinationLocation] = useState('');
  const [vehicleDetails, setVehicleDetails] = useState({
    registrationNumber: '',
    vehicleType: '',
    weight: ''
  });

  const onSubmit = (data) => {
    console.log('Form Data:', data);

    axios.post('YOUR_API_URL', {
      pickupLocation: data.pickupLocation,
      destinationLocation: data.destinationLocation,
      vehicleDetails: {
        registrationNumber: data.registrationNumber,
        vehicleType: data.vehicleType,
        weight: data.weight
      },
      hirer: {
        name: data.hirerName,
        phone: data.hirerPhone
      },
      driver: {
        name: data.driverName,
        phone: data.driverPhone
      },
      carCondition: data.carCondition
    })
    .then(response => {
      console.log('API Response:', response.data);
      alert("Booking submitted successfully!");
    })
    .catch(error => {
      console.error('API Error:', error);
      alert("There was an error submitting your booking.");
    });
  };

  return (
    <div className="booking-page">
      {/* Logo at the top */}
      <div className="logo-container">
        <img src={logo} alt="Robert Motoring Consult Logo" className="logo" />
      </div>

      <h1>Book a Flatbed Truck</h1>
      <form onSubmit={handleSubmit(onSubmit)}>
        {/* Pickup and Destination */}
        <div className="form-group">
          <label>Pickup Location:</label>
          <input
            type="text"
            {...register('pickupLocation')}
            value={pickupLocation}
            onChange={(e) => setPickupLocation(e.target.value)}
            placeholder="Enter Pickup Location"
          />
        </div>

        <div className="form-group">
          <label>Destination Location:</label>
          <input
            type="text"
            {...register('destinationLocation')}
            value={destinationLocation}
            onChange={(e) => setDestinationLocation(e.target.value)}
            placeholder="Enter Destination Location"
          />
        </div>

        {/* Vehicle Details */}
        <div className="form-group">
          <label>Vehicle Registration Number:</label>
          <input
            type="text"
            {...register('registrationNumber')}
            value={vehicleDetails.registrationNumber}
            onChange={(e) => setVehicleDetails({ ...vehicleDetails, registrationNumber: e.target.value })}
            placeholder="Enter Registration Number"
          />
        </div>

        <div className="form-group">
          <label>Vehicle Type:</label>
          <input
            type="text"
            {...register('vehicleType')}
            value={vehicleDetails.vehicleType}
            onChange={(e) => setVehicleDetails({ ...vehicleDetails, vehicleType: e.target.value })}
            placeholder="Enter Vehicle Type"
          />
        </div>

        <div className="form-group">
          <label>Vehicle Weight (kg):</label>
          <input
            type="number"
            {...register('weight')}
            value={vehicleDetails.weight}
            onChange={(e) => setVehicleDetails({ ...vehicleDetails, weight: e.target.value })}
            placeholder="Enter Vehicle Weight"
          />
        </div>

        {/* Hirer Details */}
        <div className="form-section">
          <h3>Hirer Details</h3>
          <div className="form-group">
            <label>Name:</label>
            <input type="text" {...register('hirerName')} placeholder="Full Name of Hirer" />
          </div>
          <div className="form-group">
            <label>Phone Number:</label>
            <input type="tel" {...register('hirerPhone')} placeholder="Phone Number of Hirer" />
          </div>
        </div>

        {/* Driver Details */}
        <div className="form-section">
          <h3>Driver at Pickup Location</h3>
          <div className="form-group">
            <label>Name:</label>
            <input type="text" {...register('driverName')} placeholder="Driver's Full Name" />
          </div>
          <div className="form-group">
            <label>Phone Number:</label>
            <input type="tel" {...register('driverPhone')} placeholder="Driver's Phone Number" />
          </div>
        </div>

        {/* Condition Description */}
        <div className="form-group">
          <label>Condition of the Car Upon Collection:</label>
          <textarea
            {...register('carCondition')}
            placeholder="Brief description of the car's condition (e.g. Broken axle, no front wheels, etc.)"
          />
        </div>

        {/* Submit */}
        <div className="form-group">
          <button type="submit">Submit Booking</button>
        </div>
      </form>
    </div>
  );
};

export default BookingPage;
